    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Rachel Carson NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Rachel Carson NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, a summary of Refuge
    resources, information about the management direction, and strategies for implementation.
    Key planning issues include: habitat, fish and wildlife population management, water
    quality, partnerships, public use, volunteers, and invasive species management.",nt"license_title":
